import logo from './logo.svg';
import './App.css';

function ContentItem() {
  return (
    <div className="content-item">
      <img src='./placeholder.jpeg' alt="placeholder"/>
      <div className="source-title">Título recurso</div>
      <div className="description">Lorem ipsum dolor sit amet</div>
    </div>
  )
}

function ContentList(content) {
  return (
    <div className="content-list">
      <div className="content-list-title">Título lista</div>
      <div className="line-list" />
      <div className="order-text">Ordenar A-Z</div>
      <ul className="list-container">
        {content.map((value) => {
          return <ContentItem key={value.sectionName} content={value} />
        })}
      </ul>
    </div>
  );
}

function App() {
  //console.log(getContent().result)
  getContent()

  let a
  console.log(a)

  return (
    <div className="App">
      <div className="top-menu">
        <div className="group-menu">

        </div>
        <div className="active-bar"></div>
        <div className="vector"></div>
      </div>
      <div className="content">
        <div className="section-title">Talleres</div>
        {/* <ContentList content={getContent()}/> */}
      </div>
    </div>
  );

  function getContent() {
    return (
      fetch("https://api.mocklets.com/p68016/talleres")
        .then(response => response.json())
        .then(data => a= data)
        //.then(r => r.data)
        //.then(data => console.log(data))
        //.then(data => data)
        //.then (data => ({ result: data }))
        //.then (data => JSON.parse(data))
    )
  }
}

export default App;
